import React from "react";
import "./Home.css";
import dairyImage from "../assets/dairy.jpg";

const Home = () => {
  return (
    <div className="home-container">
      {/* Navbar */}
      <nav className="navbar">
        <div className="logo">Dairy Farm</div>
        <div>
          <a href="/" className="nav-link">Home</a>
          <a href="/login" className="nav-link">Login</a>
          <a href="/register" className="nav-link">Register</a>
        </div>
      </nav>

      {/* Hero Section with background */}
      <div
        className="hero"
        style={{
          backgroundImage: `url(${dairyImage})`,
          backgroundSize: "cover",
          backgroundPosition: "center",
          height: "70vh",
          display: "flex",
          flexDirection: "column",
          justifyContent: "center",
          alignItems: "center",
          color: "#fff",
          textShadow: "2px 2px 8px rgba(0,0,0,0.6)"
        }}
      >
        <h2>Welcome to Dairy Farm</h2>
        <p>Fresh milk delivered to your doorstep</p>
        <div className="hero-buttons">
          <a href="/login" className="btn btn-primary">Login</a>
          <a href="/register" className="btn btn-secondary">Register</a>
        </div>
      </div>

      {/* Footer */}
      <footer className="footer">
        <p>Â© 2025 Dairy Farm. All Rights Reserved.</p>
      </footer>
    </div>
  );
};

export default Home;
